import React from "react";
import "./QuantificationPage.css"
import Datetime from 'react-datetime';
import "react-datetime/css/react-datetime.css";
import moment from 'moment';
import 'moment/locale/zh-cn';

class QuantificationPage extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className='QuantificationPage'>
                <span>
                    <h2>量化小平台</h2>
                    <SelectorTool />
                </span>
            </div>
        )
    }
}

class SelectorTool extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            "ts": new Date().getTime()
        }
    }

    render() {
        return (
            <div className='SelectorTool'>
                <span>
                    <h3>选股小工具</h3>
                    时间: <Datetime locale="zh-cn" onChange={this.dateOnChange()}/>
                </span>
            </div>
        )
    }

    dateOnChange(e) {
        console.info(e)
    }
}

export default QuantificationPage;
